[{"location":"","page":"Home","title":"Home","text":"CurrentModule = STACatalogs","category":"page"},{"location":"#STACatalogs","page":"Home","title":"STACatalogs","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for STACatalogs.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [STACatalogs]","category":"page"},{"location":"#STACatalogs.STACatalog-Tuple{Any}","page":"Home","title":"STACatalogs.STACatalog","text":"cat = STACatalog(url)\n\nOpen a SpatioTemporal Asset Catalog (STAC) using the provided url. The url should point to a JSON object conforming to the STAC specification.\n\ncat behaves as a julia dictionary with all STAC subcatalogs. cat.items is a dictionary with all STAC items.\n\nusing STACatalogs\nurl = \"https://raw.githubusercontent.com/sat-utils/sat-stac/master/test/catalog/catalog.json\"\ncat = STACatalog(url)\nsubcat = cat[\"stac-catalog-eo\"]\nsubcat1 = subcat[\"landsat-8-l1\"]\n@show subcat1\n\nitem = subcat1.items[\"LC08_L1TP_152038_20200611_20200611_01_RT\"]\n@show item.assets[:B4][:href]\n\n\n\n\n\n","category":"method"}]
